// export default TodoList;
import React from 'react';
import Todo from './Todo';

function TodoList({ todos }) {
  function todoDeleteHandler() {
    todos.find((_, idx) => !idx === index);
  }
  return (
    <div>
      {todos.map((todo, index) => (
        <Todo
          key={index}
          todo={todo}
          index={index}
          tododelete={todoDeleteHandler}
        />
      ))}
    </div>
  );
}

export default TodoList;
